import Link from 'next/link';
import MainLayout from '../layouts/MainLayout';

const linkStyle = {
  marginRight: '20px',
};


const MyFirstView = () => (
  <section>
    <Link href='/profile'>
      <a style={linkStyle}>Profile</a>
    </Link>
    <Link href='/shows'>
      <a style={linkStyle}>Shows</a>
    </Link>

    <p>Hola Mundo</p>
  </section>
);

MyFirstView.Layout = MainLayout;


export default MyFirstView;
